import './Expenses.css'
import ExpenseItem from './ExpenseItem.JS';
function Expenses(props){


    return(
        <card className="expenses">
        <h2>Let's get started!</h2>
        <h3>hello there</h3>
        <ExpenseItem 
        title={props.expenses1[0].title} // pass data into expense item
        amount={props.expenses2[0].amount}
        date={props.expenses3[0].date}
        />
        <ExpenseItem
              title={props.expenses1[1].title}
              amount={props.expenses2[1].amount}
              date={props.expenses3[1].date}/>
        <ExpenseItem
              title={props.expenses1[2].title}
              amount={props.expenses2[2].amount}
              date={props.expenses3[2].date}/>
        <ExpenseItem
              title={props.expenses1[3].title}
              amount={props.expenses2[3].amount}
              date={props.expenses[3].date}/>
  
      </card>


    )
}
export default Expenses;
